  [],\n\t\"revision_timestamp\": \"2015-05-07T01:30:36.862996\",\n\t\"name\": \"planetary-instrument-definition-and-development-program-piddp-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;rntResults of PIDDP have contributed
  to the development of flight hardware flown on, or selected for, many of NASA&amp;rsquo;s
  planetary missions. The instrument technology selected through PIDDP addresses specific
  scientific objectives of likely future science missions. Instrument definition and
  development studies take place at several stages, including feasibility studies,
  conceptual design, laboratory breadboarding, brassboarding, and testing of critical
  components and complete instruments. The technology readiness level (TRL) that PIDDP
  supports is TRL 1-6. For immature or particularly complex new instruments, proposers
  initially may choose to only define or develop the most risky components. When the
  proposed effort is for a component only, the proposed effort describes one or more
  likely scenarios for possible follow-on instrument development. Scientific objectives
  of the instruments, proposed follow-on instruments, and future candidate missions
  are discussed in the proposal for each selected activity. It is the responsibility
  of the proposer to demonstrate how their proposed instruments address significant
  scientific questions relevant to stated NASA goals and not for NASA to attempt to
  infer this.&lt;/p&gt;rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
